import { actionTypes } from '../actions/actionTypes';

export function activeWorkoutReducer(state = null, action) {
  switch (action.type) {
    case actionTypes.SET_SELECTED_WORKOUT_ID:
      return action.payload;
    default:
      return state;
  }
}
